import React, { useState, useContext } from "react";
import { Link as RouterLink, useNavigate } from "react-router-dom";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import IconButton from "@mui/material/IconButton";
import Typography from "@mui/material/Typography";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import MenuIcon from "@mui/icons-material/Menu";
import AccountCircle from "@mui/icons-material/AccountCircle";
import { AuthContext } from "../context/AuthContext";

const Navbar = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();

  const [anchorEl, setAnchorEl] = useState(null);
  const open = Boolean(anchorEl);

  const handleMenuOpen = (event) => setAnchorEl(event.currentTarget);
  const handleMenuClose = () => setAnchorEl(null);

  const handleLogout = () => {
    logout();
    handleMenuClose();
    navigate("/");
  };

  // Si el token incluye el role en el objeto user, use user.role. En el ejemplo del contexto
  // user es { token } — si guardas decoded user deberías usar user.role. Aquí lo intentamos leer.
  const role = user && user.role ? user.role : null;

  return (
    <AppBar position="static">
      <Toolbar>
        <Typography
          variant="h6"
          component={RouterLink}
          to="/"
          sx={{ color: "inherit", textDecoration: "none", flexGrow: 1 }}
        >
          MiApp Crédito
        </Typography>

        {/* menú para pantallas grandes */}
        <Box sx={{ display: { xs: "none", md: "flex" }, gap: 1 }}>
          {user && (
            <Button component={RouterLink} to="/dashboard" color="inherit">
              Dashboard
            </Button>
          )}

          <Button component={RouterLink} to="/campanas" color="inherit">
            Campañas
          </Button>

          {user && role === "admin" && (
            <Button component={RouterLink} to="/admin" color="inherit">
              Admin
            </Button>
          )}
        </Box>

        {/* si hay usuario muestra icono con dropdown */}
        {user ? (
          <>
            <IconButton
              size="large"
              edge="end"
              color="inherit"
              onClick={handleMenuOpen}
              aria-controls={open ? "account-menu" : undefined}
              aria-haspopup="true"
            >
              <AccountCircle />
            </IconButton>

            <Menu
              id="account-menu"
              anchorEl={anchorEl}
              open={open}
              onClose={handleMenuClose}
              anchorOrigin={{ vertical: "bottom", horizontal: "right" }}
              transformOrigin={{ vertical: "top", horizontal: "right" }}
            >
              <MenuItem
                onClick={() => {
                  handleMenuClose();
                  navigate("/profile");
                }}
              >
                Perfil
              </MenuItem>

              {role === "admin" && (
                <MenuItem
                  onClick={() => {
                    handleMenuClose();
                    navigate("/admin");
                  }}
                >
                  Panel Admin
                </MenuItem>
              )}

              <MenuItem onClick={handleLogout}>Cerrar sesión</MenuItem>
            </Menu>
          </>
        ) : (
          // si no está autenticado, mostrar login/register
          <Box sx={{ display: { xs: "none", md: "flex" }, gap: 1 }}>
            <Button component={RouterLink} to="/login" color="inherit">
              Iniciar sesión
            </Button>
            <Button component={RouterLink} to="/register" color="inherit">
              Registrarse
            </Button>
          </Box>
        )}

        {/* menu para pantallas pequeñas */}
        <Box sx={{ display: { xs: "flex", md: "none" } }}>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            onClick={(e) => {
              // simple menu abierto con las mismas opciones
              handleMenuOpen(e);
            }}
          >
            <MenuIcon />
          </IconButton>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
